import React from 'react';
import './Footer.css'


function Footer() {
  return (
    <div>
      <div class="row">
              <div class="medium-12 columns" id="Footer">
                <h3>BlockPark Ltd.</h3>
              </div>
            </div>
    </div>
  );
}

export default Footer
